import React from "react";

const SectionImg = ({ title, p, button, btnClass, pClass, img1, img2 }) => {
  return (
    <div className="d-flex mt-5 justify-content-around mb-5 align-items-center w-50">
      <div className="w-50">
        <img src={img1} />

        <h2>{title}</h2>
        <p className={pClass}>{p}</p>
        <button style={{ backgroundColor: "#212529" }} className={btnClass}>
          {button}
        </button>
      </div>
      <div>
        <img className="shadow-lg p-3 mb-5 bg-white rounded" src={img2} />
      </div>
    </div>
  );
};

export default SectionImg;
